      "content": "TODO\n----\n\nClean up build/compiler stuff\n\nClean Up Dependencies\n\nDependecy Explorer\n\n\"Open In Editor\" link on published apps\n\n\nTOMAYBE\n-------\n\nPlugins\n- Install plugins from JSON url\n- Cache installed plugins\n- Remove plugins\n- Lifecycle events (open file, before save)\n",
      "mode": "100644",
