      "path": "lib/token-storage.coffee",
      "content": "module.exports = (I, self) ->\n  self.extend\n    getToken: (key) ->\n      Promise.resolve()\n      .then ->\n        localStorage[key]\n  \n    setToken: (key, value) ->\n      Promise.resolve()\n      .then ->\n        localStorage[key] = value\n        return value\n",
