    "test/issues": {
      "path": "test/issues",
      "content": "(function() {\n  var Issue, Issues;\n\n  require(\"cornerstone\");\n\n  Issue = require(\"../models/issue\");\n\n  Issues = require(\"../models/issues\");\n\n  describe(\"issues\", function() {\n    it(\"should be chill\", function() {\n      return assert(Issues());\n    });\n    return it(\"should have a default null Issue\", function() {\n      return assert(Issues().issues.size() === 1);\n    });\n  });\n\n  describe(\"main\", function() {\n    return it(\"should have stuff\", function() {\n      assert(Issue);\n      return assert(Issues);\n    });\n  });\n\n  describe(\"Issue\", function() {\n    return it(\"should have a full description\", function() {\n      return assert(Issue().fullDescription());\n    });\n  });\n\n}).call(this);\n",
      "type": "blob"
    },
    "test/packager": {
      "path": "test/packager",
      "content": "(function() {\n  var Packager, dependencies;\n\n  Packager = require(\"../packager\");\n\n  dependencies = require(\"../pixie\").dependencies;\n\n  describe(\"Packager\", function() {\n    describe(\"building a package\", function() {\n      return it(\"should have the correct script links\", function() {\n        var html, pkg, relativePackagePath;\n        pkg = Packager.standAlone(PACKAGE);\n        relativePackagePath = Packager.relativePackagePath(PACKAGE);\n        html = pkg[0].content;\n        return assert(html.match(RegExp(\"\\\"\" + relativePackagePath + \"\\\"\")));\n      });\n    });\n    it(\"should fail to build if a resource doesn't exist\", function(done) {\n      return Packager.collectDependencies({\n        notFound: \"distri/does_not_exist:v0.0.0\"\n      })[\"catch\"](function(message) {\n        assert.equal(message, \"Error: Failed to load package 'distri/does_not_exist:v0.0.0' from https://distri.github.io/does_not_exist/v0.0.0.json\");\n        return done();\n      })[\"catch\"](done);\n    });\n    return it(\"should be able to collect remote dependencies\", function(done) {\n      return Packager.collectDependencies(dependencies).then(function(results) {\n        assert.equal(results.require.entryPoint, \"main\");\n        return done();\n      }, function(errors) {\n        throw errors;\n      });\n    });\n  });\n\n  describe(\"http dependencies\", function() {\n    it(\"should be able to have http dependencies\", function(done) {\n      return Packager.collectDependencies({\n        httpRemote: \"https://s3.amazonaws.com/trinket/18894/data/00090d8da958fb538def3533dcf1ff3a85bc2054\"\n      }).then(function(dependencies) {\n        assert(dependencies.httpRemote);\n        console.log(dependencies);\n        return done();\n      });\n    });\n    it(\"should display an error message when file is not found\", function(done) {\n      return Packager.collectDependencies({\n        httpRemote: \"https://s3.amazonaws.com/trinket/18894/data/notfoundnotarealsha\"\n      })[\"catch\"](function(message) {\n        assert.equal(message, \"404 Not Found: https://s3.amazonaws.com/trinket/18894/data/notfoundnotarealsha\");\n        return done();\n      });\n    });\n    return it(\"should display an error message when domain is not legit\", function(done) {\n      return Packager.collectDependencies({\n        httpRemote: \"https://notfound.yolo.biz.info/duder.json\"\n      })[\"catch\"](function(message) {\n        assert.equal(message, \"0 Aborted: https://notfound.yolo.biz.info/duder.json\");\n        return done();\n      });\n    });\n  });\n\n}).call(this);\n",
      "type": "blob"
    },
    "test/runner": {
      "path": "test/runner",
      "content": "(function() {\n  var PackageRunner, Runner;\n\n  PackageRunner = (Runner = require(\"../runner\")).PackageRunner;\n\n  describe(\"Runner\", function() {\n    return it(\"should be able to open a window with content\", function(done) {\n      var p;\n      p = new Promise(function(resolve) {\n        return setTimeout(function() {\n          return resolve(\"some content\");\n        });\n      });\n      return Runner.openWindowWithContent({}, p).then(function(sandbox) {\n        assert.equal(sandbox.document.body.innerText, \"some content\");\n        sandbox.close();\n        return done();\n      })[\"catch\"](function(err) {\n        return console.log(err);\n      });\n    });\n  });\n\n  describe(\"PackageRunner\", function() {\n    it(\"should be separate from the popup\", function(done) {\n      var launcher;\n      launcher = PackageRunner();\n      launcher.launch(PACKAGE);\n      assert(launcher[\"eval\"](\"window !== top\"));\n      launcher.close();\n      return done();\n    });\n    it(\"should have a window\", function(done) {\n      var launcher;\n      launcher = PackageRunner();\n      assert(launcher.window);\n      assert(launcher.window !== window);\n      launcher.close();\n      return done();\n    });\n    it(\"should share console with the popup\", function(done) {\n      var launcher;\n      launcher = PackageRunner();\n      launcher.launch(PACKAGE);\n      assert(launcher[\"eval\"](\"console === top.console\"));\n      launcher.close();\n      return done();\n    });\n    return it(\"should share opener with the popup\", function(done) {\n      var launcher;\n      launcher = PackageRunner();\n      launcher.launch(PACKAGE);\n      assert(launcher[\"eval\"](\"opener === top.opener\"));\n      launcher.close();\n      return done();\n    });\n  });\n\n}).call(this);\n",
      "type": "blob"
    },
