    "views/code-area": {
      "path": "views/code-area",
      "content": "\n/*\nThe Code Area View provides a multi-session ace editor element.\n\nRequire these dependencies in pixie.cson:\n\n  \"https://cdnjs.cloudflare.com/ajax/libs/ace/1.2.9/ace.js\"\n  \"https://cdnjs.cloudflare.com/ajax/libs/ace/1.2.9/ext-language_tools.js\"\n */\n\n(function() {\n  ace.require(\"ace/ext/language_tools\");\n\n  module.exports = function() {\n    var aceEditor, editorElement;\n    editorElement = document.createElement('div');\n    aceEditor = ace.edit(editorElement);\n    aceEditor.$blockScrolling = Infinity;\n    aceEditor.setOptions({\n      fontSize: \"16px\",\n      enableBasicAutocompletion: true,\n      enableLiveAutocompletion: true\n    });\n    return {\n      element: editorElement,\n      aceEditor: function() {\n        return aceEditor;\n      },\n      goto: function(line) {\n        aceEditor.moveCursorTo(line, 0);\n        aceEditor.clearSelection();\n        aceEditor.scrollToLine(line, true, false, function() {});\n      },\n      setSession: function(session, readOnly) {\n        if (readOnly == null) {\n          readOnly = false;\n        }\n        aceEditor.setSession(session);\n        aceEditor.setReadOnly(readOnly);\n        aceEditor.focus();\n      },\n\n      /*\n      Initialize a session to track an observable\n       */\n      initSession: function(contentObservable) {\n        var session, updating;\n        session = ace.createEditSession(contentObservable());\n        session.setUseWorker(false);\n        session.setUseSoftTabs(true);\n        session.setTabSize(2);\n        aceEditor.setOptions({\n          highlightActiveLine: true\n        });\n        updating = false;\n        contentObservable.observe(function(newContent) {\n          if (updating) {\n            return;\n          }\n          return session.setValue(newContent);\n        });\n        session.on(\"change\", function() {\n          updating = true;\n          contentObservable(session.getValue());\n          return updating = false;\n        });\n        return session;\n      }\n    };\n  };\n\n}).call(this);\n",
      "type": "blob"
    },
    "modules/ace-shim": {
      "path": "modules/ace-shim",
      "content": "(function() {\n  var CodeArea, Hygiene, extraModes, mode;\n\n  CodeArea = require(\"../views/code-area\");\n\n  Hygiene = require(\"../hygiene\");\n\n  extraModes = {\n    jadelet: \"jade\",\n    styl: \"stylus\"\n  };\n\n  mode = function(mode) {\n    return extraModes[mode] || mode;\n  };\n\n  module.exports = function(I, self) {\n    var aceEditor, codeArea, nullSession;\n    codeArea = CodeArea();\n    aceEditor = codeArea.aceEditor();\n    nullSession = ace.createEditSession(\"\");\n    self.extend({\n      editorElement: function() {\n        return codeArea.element;\n      },\n      goto: function(file, line) {\n        self.filetree().selectedFile(file);\n        return codeArea.goto(line);\n      },\n      closeOpenEditors: function() {\n        return codeArea.setSession(nullSession, true);\n      }\n    });\n    return self.filetree().selectedFile.observe(function(file) {\n      var fileMode, session;\n      if (typeof file.binary === \"function\" ? file.binary() : void 0) {\n        return;\n      }\n      if (!file.session) {\n        switch (file.path().extension()) {\n          case \"md\":\n          case \"coffee\":\n          case \"js\":\n          case \"styl\":\n          case \"cson\":\n            file.content(Hygiene.clean(file.content()));\n        }\n        session = codeArea.initSession(file.content);\n        file.session = session;\n        fileMode = mode(file.mode());\n        session.setMode(\"ace/mode/\" + fileMode);\n      }\n      return codeArea.setSession(session);\n    });\n  };\n\n}).call(this);\n",
      "type": "blob"
    },
